import React, { useState } from 'react';
import Header from './Header'; // Import Header component
import './Cart.css';

function Cart({ navigateTo }) {
  const [formData, setFormData] = useState({
    name: '',
    phoneNumber: '',
    email: ''
  });

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData({
      ...formData,
      [name]: value
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // Handle form submission logic here, e.g., send data to backend, validate, etc.
    console.log('Form submitted:', formData);
    // Optionally navigate to another page after submission
    // navigateTo('some-other-page');
  };

  return (
    <div>
      <Header navigateTo={navigateTo} /> {/* Include Header component */}
      <div className="cart-container">
        <div className="cart-header">
          <h2 className="cart-title">Contact Information</h2>
          <button className="cart-close-button">&times;</button>
        </div>
        <form className="cart-form" onSubmit={handleSubmit}>
          <div className="form-group">
            <label htmlFor="name">Name:</label>
            <input
              type="text"
              id="name"
              name="name"
              value={formData.name}
              onChange={handleInputChange}
              required
            />
          </div>
          <div className="form-group">
            <label htmlFor="phoneNumber">Phone Number:</label>
            <input
              type="tel"
              id="phoneNumber"
              name="phoneNumber"
              value={formData.phoneNumber}
              onChange={handleInputChange}
              required
            />
          </div>
          <div className="form-group">
            <label htmlFor="email">Email:</label>
            <input
              type="email"
              id="email"
              name="email"
              value={formData.email}
              onChange={handleInputChange}
              required
            />
          </div>
          <button type="submit" className="cart-submit-button">Submit</button>
        </form>
      </div>
    </div>
  );
}

export default Cart;
